import React from 'react';
import Icons from '@mui/icons-material';
import { useHistory } from 'react-router-dom';


import { Box, TextField, Button, CloseIcon, Typography, Paper } from '@mui/material';

export default function Signin() {
  let history = useHistory();
    const signin = () => {
        history.push("/");
    }
  const paperStyle = {
    padding: 20,
    height: "55vh",
    width: 360,
    margin: "8% auto",

}
  return (
    <>
      <Box
        className='sec'
        sx={{
          
          width: '400px',
          position: 'absolute',
          left: '30%',
          top: '20%',
        }}
        
      >
         <Paper elevation={10} style={paperStyle}>
        <div className='signip-form'>
         
          <Typography variant='h5' sx={{ mt: 2, ml:17 }} component='h2'>
            Sign in
          </Typography>
          <form className='register-form' id='register-form'>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  label='Name'
                 
                  variant='outlined'
                />
              </Box>
            </div>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  label='Email'
                  
                  variant='outlined'
                />
              </Box>
            </div>

            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
               
              >
                <TextField
                  required
                  id='outlined-basic'
                  label='Password'
                  
                  variant='outlined'
                />
              </Box>
            </div>

            <div>
              <Button variant='contained' onClick={signin} sx={{
                 ml:17, mt:3
                }}
                noValidate
                >Sign in</Button>
            </div>
          </form>
          
        </div>
        </Paper>
      </Box>
    </>
  );
}
